import React,{useState} from "react";
import {Form} from 'react-bootstrap';
import "./Login.css";
import FacebookIcon from '@mui/icons-material/Facebook';
import TwitterIcon from '@mui/icons-material/Twitter';
import GoogleIcon from '@mui/icons-material/Google';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import CampaignIcon from '@mui/icons-material/Campaign';
import PermIdentityOutlinedIcon from '@mui/icons-material/PermIdentityOutlined';
import TextField from "@mui/material";
function Login(){
    const[user,setUser] = useState({
        Email:"",
        Password:""
    })


    const url="";
    return <>
        <Form className="login-div">
        <h2>WELCOME TO</h2>
        <h1><CampaignIcon className="speaker" fontSize="60" />Quizz</h1>
        <h5>Login to Enter the quizz world And check your knowledge </h5>
        <input type="email" name="" id="" placeholder={ <PermIdentityOutlinedIcon />} />
        <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        <input type="password" name="" id="" /><br />
        <button>Login</button>
        <h6>Don't have an account ? <a href={url}>Sign Up Now </a></h6>
        <hr />
        <h6>Continue With Social Media</h6>
        <ul className="socials">
        <li><FacebookIcon /></li>
        <li><TwitterIcon /></li>
        <li><GoogleIcon /></li>
        <li><LinkedInIcon /></li>
        </ul>
        </Form>
    </>
}

export default Login;
